import { Link } from "react-router-dom";

export function Create() {
  return (
    <div>
      <form className="logincon">
        <input type="text" placeholder="Enter trip name" />
        <div className="loginbtn">
          <Link>
            <button>Create</button>
          </Link>
          <Link to={"/"}>
            <button>Back</button>
          </Link>
        </div>
      </form>
    </div>
  );
}
